const FILE_SYSTEM = require("fs");

FILE_SYSTEM.readFile("Elements.json", "utf8", function(error, data) {
	let json = this.responseText;
	ReactDOM.render(<PeriodicTable jsonData={json} />, document.getElementById("root"));
});
